import React from 'react';

function Header() {
    return (
        <header className="header">
            <h1>My Portfolio</h1>
            <nav className="navbar">
                <a href="/">Home</a>
                <a href="/about">About</a>
                <a href="/projects">Projects</a>
                <a href="/contact">Contact</a>
            </nav>
        </header>
    );
}

export default Header;
